import React from "react";

const ContactList = ({contacts}) => {
    return <div>
        <ul>
            {contacts.map((contact) => {
                <li>
                    <p>name:{contact.name}</p>
                    <p>tel:{contact.number}</p>
                    <p>sex:{contact.sex}</p>
                </li>
            })}
        </ul>

    </div>
}

export default ContactList
